Thank you so much, #IncrediblyAverage, for posting this truth-seeking video of your thorough and in-dept analysis of the events.   Since I don't know how to contact Mr. #johnnydepp, with your permission, I'd like to post encouraging words for Mr. #johnnydepp using this platform.... 

Dear Mr. JOHNNY DEPP: 

You're HARD PRESSED on every side of social media based on false allegations, BUT DON'T be CRUSHED;
You're PERPLEXED by this vicious and fabricated attacks, BUT DON'T be in DESPAIR; 
You're PERSECUTED by unwarranted and unfounded public opinion based on lies, BUT you're NOT ABANDONED; 
You're STRUCK with infidelity, betrayal, greed, and total selfishness, BUT you're NOT DESTROYED!
Be of good cheers, courage and don't be afraid, Mr. #JOHNNYCHRISTOPHERDEPP , for all truth-seeking fans are on your side.  Truth prevails always!! 
May your next set of tears be the tears of joy and triumph!!  We feel your pain and we're with YOU through prayers!!

Your humble fan,
Inki Welch
